import React from "react";
import PropTypes from "prop-types";

const Navbar = (props) => {

    return (
      <nav className="navbar bg-primary">
        <h2>{props.title}</h2>
      </nav>
    );

}

Navbar.defaultProps = {
  title: "You forget Add Props..",
};

Navbar.propTypes = {
  title: PropTypes.string.isRequired,
};

export default Navbar;
